import React from 'react'
import './Nav.css'
import {NavLink} from 'react-router-dom'
import Form from './Form'
import {Breakpoint, BreakpointProvider} from 'react-socks'
const Nav=()=>{
    function click(){
        var x=document.getElementById('form')
        if(x.style.display==='none'){
          x.style.display='block'
         
        }
           else{
          x.style.display='none'
        }
       }
       const login={
         backgroundColor:'rgb(36 70 25)',
         color:'white',
         border:'none',
         borderRadius:'4px',
         padding:'7px',
         width:'130px',
         boxShadow:'0 2px 3px black'
         
       };
      
      
      const form1={display:'none'
    }
    return(
        <>
      <Breakpoint large up>
        <section className='navbar'>
            <div className='navbar1'>
                <a href='http://localhost:3000/' style={{textDecoration:'none',color:'black'}}>HariCharan</a>
            </div>
            <div className='navbar2'>
         <NavLink to ='/' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}} >Home</NavLink>
         <NavLink to ='/About'  style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>About</NavLink>
 <NavLink to ='/Service' style={{textDecoration:'none',color:'rgb(85, 17, 85)'}}>Service</NavLink>

            </div>
          <div className='navbar3'>
        <button onClick={click} style={login}>Login/Signup</button>
            </div>
          
        </section>
        </Breakpoint>
        <Breakpoint small down>
        <p>hai</p>
        </Breakpoint>
        <Breakpoint small down>
        <p>hai</p>
        </Breakpoint>
       <section id='form' style={form1}>
         <Form/>
       </section>
       
        
       </> 
          
    );
}
export default Nav;
